import React from 'react';
import Cardlist from './Cardlist';
import SearchBox from './SearchBox';
import { robots } from './robofriends';

const state = {
	robot: robots,
	searchfield: ''
}

class App extends Component {
	render() {
		return (
			<div className='tc'>
				<h1>RoboFriends</h1>
				<SearchBox />
				<Cardlist robots={robots} />
			</div>

		);
	}
}

export default App;
